(2281, 192, '_about__title', 'field_5f5df17a7439a'),
(2282, 192, 'about__text-1', 'Гостевой дом «Дом Баня» с принадлежностями для барбекю расположен в Калининграде в Калининградской области, в 5 км от стадиона «Калининград» и в 6 км от кирхи Святого Семейства. Гостевой дом находится примерно в 6 км от Кенигсбергского собора в 8 км от Росгартенских ворот и в 8 км от Музея янтаря.'),
(2283, 192, '_about__text-1', 'field_5f5df1b87439b'),
(2284, 192, 'about__text-2', 'Номера оснащены телевизором c кабельными каналами, микроволновой печью, чайником, биде, феном и шкафом для одежды. В распоряжении гостей общая ванная комната с бесплатными туалетно-косметическими принадлежностями. В гостевом доме «Дом Баня» можно поиграть в бильярд. Гостевой дом находится в 10 км от района Марауненхоф и в 3,8 км от церкви Розенау. Расстояние от гостевого дома «Дом Баня» до аэропорта Храброво составляет 28 км.'),
(2285, 192, '_about__text-2', 'field_5f5df2337439c'),
(2286, 192, 'about__text-3', 'Мы говорим на вашем языке!'),
