(3872, 222, 'about__text-2', 'Номера оснащены телевизором c кабельными каналами, микроволновой печью, чайником, биде, феном и шкафом для одежды. В распоряжении гостей общая ванная комната с бесплатными туалетно-косметическими принадлежностями. В гостевом доме «Дом Баня» можно поиграть в бильярд. Гостевой дом находится в 10 км от района Марауненхоф и в 3,8 км от церкви Розенау. Расстояние от гостевого дома «Дом Баня» до аэропорта Храброво составляет 28 км.'),
(3873, 222, '_about__text-2', 'field_5f5df2337439c'),
(3874, 222, 'about__text-3', 'Мы говорим на вашем языке!'),
