(43, 1, '2020-09-13 13:28:54', '2020-09-13 10:28:54', 'a:10:{s:4:\"type\";s:8:\"textarea\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:538:\"Гостевой дом «Дом Баня» с принадлежностями для барбекю расположен в Калининграде в Калининградской области, в 5 км от стадиона «Калининград» и в 6 км от кирхи Святого Семейства. Гостевой дом находится примерно в 6 км от Кенигсбергского собора в 8 км от Росгартенских ворот и в 8 км от Музея янтаря.\";s:11:\"placeholder\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";s:4:\"rows\";s:0:\"\";s:9:\"new_lines\";s:0:\"\";}', 'Первый параграф текста', 'about__text-1', 'publish', 'closed', 'closed', '', 'field_5f5df1b87439b', '', '', '2020-09-14 03:14:16', '2020-09-14 00:14:16', '', 18, 'http://banya/?post_type=acf-field&#038;p=43', 15, 'acf-field', '', 0),
(44, 1, '2020-09-13 13:28:54', '2020-09-13 10:28:54', 'a:10:{s:4:\"type\";s:8:\"textarea\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:779:\"Номера оснащены телевизором c кабельными каналами, микроволновой печью, чайником, биде, феном и шкафом для одежды. В распоряжении гостей общая ванная комната с бесплатными туалетно-косметическими принадлежностями. В гостевом доме «Дом Баня» можно поиграть в бильярд. Гостевой дом находится в 10 км от района Марауненхоф и в 3,8 км от церкви Розенау. Расстояние от гостевого дома «Дом Баня» до аэропорта Храброво составляет 28 км.\";s:11:\"placeholder\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";s:4:\"rows\";s:0:\"\";s:9:\"new_lines\";s:0:\"\";}', 'Второй параграф', 'about__text-2', 'publish', 'closed', 'closed', '', 'field_5f5df2337439c', '', '', '2020-09-16 01:55:20', '2020-09-15 22:55:20', '', 18, 'http://banya/?post_type=acf-field&#038;p=44', 16, 'acf-field', '', 0);
